import React, {useState, useEffect} from 'react';

import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Navigation from './components/Navigation'
import Home from './pages/Home'

function App() {
  return (
    <div className="App">
    <BrowserRouter>
      <Navigation/>
      <div className="pages">
        <Routes>
          <Route path="/" element={<Home/>}/>
        </Routes>
      </div>
    </BrowserRouter>
    </div>
  )
}

export default App;
